var isAllowed;
var gr = new GlideRecord("x_snc_demo_screen_daily_assessment_response");
gr.addQuery("parent", workflow.scratchpad.assessment_id);
gr.addQuery("question_number", 3);
gr.query();
if (gr.next()) {
	// If response of Q idx 3 exists then it has to be y
	if (gr.answer + '' === "y")
		isAllowed = true;
	else
		isAllowed = false;
} else
	isAllowed = true;

if (isAllowed) {
	gr = new GlideRecord("x_snc_demo_screen_daily_assessment_response");
	gr.addQuery("parent", workflow.scratchpad.assessment_id);
	gr.addQuery("question_number", 4);
	gr.query();
	if (gr.next()) {
		if (gr.answer + '' === "y")
			isAllowed = true;
		else
			isAllowed = false;
	} else
		isAllowed = false;
}

workflow.scratchpad.is_allowed = isAllowed? "yes" : "no";

gr = new GlideRecord("x_snc_demo_screen_daily_assessment");
if (gr.get(workflow.scratchpad.assessment_id)) {
	workflow.scratchpad.user_name = gr.getDisplayValue("user");
	gr.status = isAllowed ? "complete_pass" : "complete_fail";
	gr.update();
} else
	workflow.scratchpad.is_allowed = "no";

