var qs = [
	"Do you have any of the following symptoms?\n- Congestion/Runny nose\n- Chills (with or without repeated shaking)\n- Recent or current shortness of breath\n- Cough\n- Headache\n- Muscle pain/body aches\n- New loss of taste or smell\n- New onset of gastrointestinal symptomps, nausea, vomiting or diarrhea\n- Sore throat\n- Fatigue\n\nReply Y for yes or N for no",
	"Do you currently have a fever or have had one in past 24hrs with a temperature of 100F(37.3째C) or higher?\nReply Y for yes or N for no",
	"Have you been currently asked to quarantine due to Covid positive exposure?\nReply Y for yes or N for no",
	"Have you been cleared by Employee Health or Human Resource to return to work?\nReply Y for yes or N for no",
	"Have you completed and passed the daily temperature scan (less than 100F(37.3째C))?\nReply Y for yes or N for no"
];

var currentQIdx = parseInt(workflow.scratchpad.last_q_idx) + 1;
if (currentQIdx >= qs.length) {
	workflow.scratchpad.is_end_of_qs = 'yes';
} else {
	workflow.scratchpad.is_end_of_qs = 'no';
	if (currentQIdx === 3) {
		var gr = new GlideRecord("x_snc_demo_screen_daily_assessment_response");
		gr.addQuery("parent", workflow.scratchpad.assessment_id);
		gr.addQuery("question_number", "IN", "0,1,2");
		gr.addQuery("answer", "y");
		gr.query();
		if (!gr.next()) {
			// There were no yes for any of the previous three questions.
			currentQIdx = 4;
		}
	}
	workflow.scratchpad.next_q = qs[currentQIdx];
	workflow.scratchpad.reply_to_no = current.getDisplayValue('notify_number');
	gr = new GlideRecord("x_snc_demo_screen_daily_assessment_response");
	gr.initialize();
	gr.setValue("parent", workflow.scratchpad.assessment_id);
	gr.setValue("question_number", currentQIdx);
	gr.insert();
}

