function isUserKnown() {
	var ph = current.phone_number + '';
	if (ph) {
		//Lookup user using ph
		var userId = new global.NotifyUtil().getUserByNumber(ph);
		if (userId) {
			workflow.scratchpad.user_id = userId;
			return 'yes';
		}
	}
	return 'no';
}
answer = isUserKnown();

