gr.addQuery("parent", workflow.scratchpad.assessment_id);
gr.addNullQuery("answer");
gr.query();gs.warn('.........workflow.scratchpad.msg_body '+workflow.scratchpad.msg_body)
workflow.scratchpad.is_valid_response = 'no';
if (gr.next()) {
	if (workflow.scratchpad.msg_body === 'y' || workflow.scratchpad.msg_body === 'n') {
		workflow.scratchpad.is_valid_response = 'yes';
		workflow.scratchpad.last_q_idx = gr.question_number + '';
		gr.answer = workflow.scratchpad.msg_body;
		gr.update();
	}
} else {
	gr = new GlideRecord("x_snc_demo_screen_daily_assessment");
	if (gr.get(workflow.scratchpad.assessment_id)) {
		gr.status = "incomplete";
		gr.update();
	}
}gs.warn('.............workflow.scratchpad.is_valid_response '+workflow.scratchpad.is_valid_response)

